description:
Nadia Styles, Danica Dillon, Holly Heart, Britney Amber, James Deen, Will Powers, Mark Wood, Erik Everhard, Marco Banderas, Ramon Nomar, John Strong

Nadia's got game! Ramon gets up close and personal with Nadia as he teaches her some tennis moves. James doesn't mind at all, and the action heats up pretty fast. Britney gets pissed when she discovers a pair of panties hidden in Marco's car. The only way he can make it up to her is by letting her fuck another man for a little DP action! John and Danica show up uninvited to Erik's place. Danica feels that she should repay him for letting them come over, and John knows just the way to do it. Holly and Will are showing Mark around a potential new home. If Holly has to get naked to convince Mark to buy, she doesn't mind.


